	public static int lengthOfLongestSubstring(String s) {
		if (s == null || s.length() == 0 ) return 0;
		int maxCount = 0;
		int i = 0;
		int j = 0;
		int strLen = s.length();
		
		while(i<strLen && j<strLen) {
			if (!st.contains(s.charAt(j))) {
				st.add(s.charAt(j));
				j++;
				maxCount = Math.max(maxCount, j-i);
			} else {
				st.remove(s.charAt(i));
				i++;
			}
		}
		return maxCount;
    }

